import React,{useState} from "react";
import "./eoamd.css";
import { Document, Page } from 'react-pdf/dist/esm/entry.webpack5';

function Eoamd({ setOpenModal }) {
    const [numPages, setNumPages] = useState(null);
    const [pageNumber, setPageNumber] = useState(1);

    function onDocumentLoadSuccess({numPages}){
        setNumPages(numPages);
        console.log("testtt;", numPages);
        setPageNumber(1);
    }
  return (
    <div className="modalBackground">
      <div className="modalContainer">
        <div className="closeBtn">
          <button
            onClick={() => {
              setOpenModal(false);
            }}
          >
            X
          </button>
        </div>

        <div className=".modalContainerContent">
            <div className="left">
                <ul>
                    <li>
                        <p>EOA 21-22</p>
                    </li>
                    <li>
                        <p>EOA 20-21</p>
                    </li>
                    <li>
                        <p>EOA 19-20</p>
                    </li>
                    <li>
                        <p>EOA 18-19</p>
                    </li>
                    <li>
                        <p>EOA 17-18</p>
                    </li>
                    <li>
                        <p>EOA 19-20</p>
                    </li>
                    <li>
                        <p>EOA 18-19</p>
                    </li>
                    <li>
                        <p>EOA 17-18</p>
                    </li>
                </ul>
            </div>
            <div className="right">
                <Document file="/EOA_Report_21_22.pdf" onLoadSuccess={onDocumentLoadSuccess}>
                    <Page height="570" pageNumber={pageNumber} />
                </Document>
            </div>    
        </div>

      </div>
    </div>
  );
}

export default Eoamd;
